import React from "react";
import { TodoCategory } from "../type";

interface Props{
    filter: string;
    setFilter: (filter: string) => void;
}

const CategoryFilter : React.FC<Props> = ({filter, setFilter}) => {
    return(
        <div className="category-filter">
            <button onClick={() => setFilter(TodoCategory.Default.valueOf())} className={ filter == TodoCategory.Default.valueOf() ? 'active' : '' } >Default</button>
            <br />
            <button onClick={() => setFilter(TodoCategory.Groceries.valueOf())} className={ filter == TodoCategory.Groceries.valueOf() ? 'active' : '' } >Default</button>
            <br />
            <button onClick={() => setFilter(TodoCategory.Food.valueOf())} className={ filter == TodoCategory.Food.valueOf() ? 'active' : '' } >Default</button>
        </div>
    );
}

export default CategoryFilter;
